import React, { useState } from 'react';
import '../styles/common.css';

function RegisterPage() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // You can add your validation logic here later
    console.log('Register:', { email, password, confirmPassword });
  };

  return (
    <div style={{ backgroundColor: '#7C6A6A', minHeight: '100vh', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
      <div style={{
        backgroundColor: '#FFB24F',
        padding: '2rem',
        border: '2px solid black',
        borderRadius: '8px',
        width: '100%',
        maxWidth: '400px',
        boxShadow: '0 4px 8px rgba(0,0,0,0.1)'
      }}>
        <h2 style={{ textAlign: 'center', marginBottom: '1.5rem', color: 'black' }}>Registration</h2>

        <form onSubmit={handleSubmit}>
          <div style={{ textAlign: 'left', marginBottom: '1rem' }}>
            <label style={{ fontWeight: 'bold' }}>Full Name</label>
            <input
              type="text"
              placeholder="Enter full name"
              required
              style={{ width: '100%', padding: '8px', marginTop: '5px' }}
            />
          </div>

          <div style={{ textAlign: 'left', marginBottom: '1rem' }}>
            <label style={{ fontWeight: 'bold' }}>Email Address</label>
            <input
              type="email"
              placeholder="Enter email address"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
              style={{ width: '100%', padding: '8px', marginTop: '5px' }}
            />
          </div>

          <div style={{ textAlign: 'left', marginBottom: '1rem' }}>
            <label style={{ fontWeight: 'bold' }}>Password</label>
            <input
              type="password"
              placeholder="Create password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
              style={{ width: '100%', padding: '8px', marginTop: '5px' }}
            />
          </div>

          <div style={{ textAlign: 'left', marginBottom: '1rem' }}>
            <label style={{ fontWeight: 'bold' }}>Confirm Password</label>
            <input
              type="password"
              placeholder="Confirm password"
              value={confirmPassword}
              onChange={(e) => setConfirmPassword(e.target.value)}
              required
              style={{ width: '100%', padding: '8px', marginTop: '5px' }}
            />
          </div>

          <button type="submit" style={{
            width: '100%',
            padding: '10px',
            backgroundColor: '#00FFFF',
            color: 'black',
            border: 'none',
            borderRadius: '4px',
            fontWeight: 'bold',
            marginBottom: '1rem'
          }}>Sign Up</button>
        </form>

        <p style={{ textAlign: 'center', fontSize: '0.9rem', marginBottom: '0.5rem' }}>
          Already have an account? <a href="#" style={{ color: '#007bff' }}>Login</a>
        </p>

        <div style={{ textAlign: 'center', margin: '10px 0' }}>
          <hr style={{ border: 'none', borderTop: '1px solid #aaa', marginBottom: '10px' }} />
          <span style={{ fontSize: '0.8rem', fontStyle: 'italic' }}>Or sign in with:</span>
        </div>

        <button style={{
          width: '100%',
          backgroundColor: '#3b5998',
          color: 'white',
          border: 'none',
          borderRadius: '4px',
          padding: '10px',
          marginBottom: '10px',
          fontWeight: 'bold'
        }}>
          Login with Facebook
        </button>

        <button style={{
          width: '100%',
          backgroundColor: '#db4437',
          color: 'white',
          border: 'none',
          borderRadius: '4px',
          padding: '10px',
          fontWeight: 'bold'
        }}>
          Login with Google
        </button>
      </div>
    </div>
  );
}

export default RegisterPage;
